import React, { useState } from "react";
import { Link } from "react-router-dom";
// import LogoImage from "./images/dttc-logo.png"

export const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);

  function handleToggleMenu() {
    setShowMenu(!showMenu);
  }

  return (
    <nav className="nav">
      {/* <Link to="/" className="site-title"><img id="logo-image" src={LogoImage} alt="logo" /></Link> */}
      <Link to="/" className="site-title">
        Dead To The Core
      </Link>
      <button className="navbar-toggler" type="button" onClick={handleToggleMenu}>
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className={`collapse navbar-collapse ${showMenu ? "show" : ""}`}>
        <ul className="nav-links">
          <li className="nav-item">
            <Link to="/band" className="nav-link" onClick={() => setShowMenu(false)}>Band</Link>
          </li>
          <li className="nav-item">
            <Link to="/tour" className="nav-link" onClick={() => setShowMenu(false)}>Tour</Link>
          </li>
          <li className="nav-item">
            <Link to="/gallery" className="nav-link" onClick={() => setShowMenu(false)}>Gallery</Link>
          </li>
          <li className="nav-item">
            <Link to="/contact" className="nav-link" onClick={() => setShowMenu(false)}>Contact</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};
